import React from 'react';
import { Route, Routes, Navigate} from "react-router-dom";

const ProtectedRoute = ({
  component: Component,
  ...props
}) => {
  return ( 

      () => props.loggedIn ? <Component {...props} /> : <Navigate to="./register" />

  )
}

export default ProtectedRoute;
